-- ----------------------------
-- Table structure for transport
-- ----------------------------
DROP TABLE IF EXISTS `transport`;
CREATE TABLE `transport` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID 唯一标识',
  `material_id` int(10) DEFAULT NULL COMMENT '物质ID',
  `material_name` varchar(255) NOT NULL,
  `source` varchar(255) DEFAULT NULL COMMENT '产地',
  `type` int(5) DEFAULT '0' COMMENT '0海， 1陆， 2空',
  `distance` double NOT NULL DEFAULT '0' COMMENT '距离',
  `version` varchar(255) NOT NULL COMMENT 'b批次',
  `user_id` bigint(255) DEFAULT NULL COMMENT '用户ID',
  `created_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `weight` double DEFAULT '0' COMMENT '载重',
  `flag` int(11) DEFAULT NULL COMMENT '属于的标识 0 原料 1 生产 2 销售 3 使用 4 回收',
  `parent_id` int(10) DEFAULT NULL COMMENT '父类ID',
  `pr_id` int(255) NOT NULL,
  `pr_name` varchar(255) DEFAULT NULL COMMENT '产品名称',
  PRIMARY KEY (`id`,`material_name`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8;

